import React from "react";
import ContentLoader from "react-content-loader";
import './css/contentLoader.css'
function ReactContent(){
    return(
        <div className="ContentLoader">
            <ContentLoader seed={1} width={400} height={200} backgroundColor="#666667" foregroundColor="#161E20">
                <rect x="0" y="0" rx="25" ry="25" width="360" height="72"/>
                <rect x="0" y="98" rx="25" ry="25" width="360" height="72"/>
                <rect x="0" y="150" rx="25" ry="25" width="360" height="72"/>
            </ContentLoader>
        </div>
    );
}

export {ReactContent};
